いい感じ！！

あ、でもたまに落ちるのが不便かなぁ', u'id': u'956081467', u'name': {u'label': u'MixerBox 無料音楽 MP3 プレイヤー musicbox'}}

{u'review': u'便利なんですが、電話番号追加を勝手にされなくなるようになるととてもいいです
知られたくない相手にも勝手に追加されてしまったのでアプリを使いづらくなってしまいました
改善よろしくお願いします', u'id': u'362057947', u'name': {u'label': u'カカオトーク-無料でグループ通話！高音質でつながる無料通話メールアプリ(KakaoTalk)'}}

{u'review': u'友達とお遊びでやるアプリですね。顔のパーツの大小ではなく位置関係で採点がかなり変わってくるみたいです。
自分の顔で試してみて真顔では伊藤英明になったり、笑顔ではジミー大西、イジリー岡田にだったり´д` ;
笑顔のまま伊藤英明に近づくにはどうすればいいのか試行錯誤したりなんかして笑 そこそこ遊べました^_^', u'id': u'739787904', u'name': {u'label': u'美男美女診断'}}

{u'review': u'ポイントを貯めるために毎日チェックインしていたのですが、最近になって”お近くに店舗がございません”と出てしまいます…。
家からすぐ近くに店舗はあるのに何故でしょうか
早く改善してほしいです。', u'id': u'906930478', u'name': {u'label': u'ガストアプリ　お得なクーポンが使える無料アプリ'}}

